import React, { useState } from 'react';
import axios from 'axios';
import { toast, ToastContainer } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import { TextField, Grid, Select, MenuItem, FormControl, InputLabel, FormHelperText, Button, Typography } from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles(theme => ({
  formContainer: {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    width: '80%',
    margin: 'auto',
    [theme.breakpoints.down('sm')]: {
      width: '100%',
    }
  },
  formSection: {
    width: '100%',
    marginBottom: theme.spacing(3),
  },
  formField: {
    width: '100%',
    margin: theme.spacing(1),
  },
  formRow: {
    display: 'flex',
    flexDirection: 'row',
    flexWrap: 'wrap',
    justifyContent: 'space-between',
  },
  formLine: {
    flex: 1,
    margin: theme.spacing(1),
    minWidth: '45%',
  },
  formDropdown: {
    width: '100%',
    margin: theme.spacing(1),
  },
  formButton: {
    marginTop: theme.spacing(2),
  },
}));

const LoanForm = () => {
  const classes = useStyles();
  
  const [formData, setFormData] = useState({
    Full_Name: '',
    Address: '',
    PAN_Number: '',
    Company_Name: '',
    Current_Salary: '',
    Previous_Salary: '',
    Owns_House: '',
    Rent_Amount: '',
    Grocery_Expense: '',
    Current_EMIs: '',
    Date_Previous_Hike: '',
    Date_Next_Hike: '',
    Bank_Name: '',
    Credit_Score: '',
    Number_of_Credit_Cards: '',
    Total_Credit_Limit: '',
    Number_of_Loans: '',
    Employment_Duration: '',
    Job_Title: '',
    Bonuses_Allowances: '',
    Savings: '',
    Investments: '',
    Monthly_Expenses: '',
    Age: '',
    Education_Level: '',
    Marital_Status: '',
    Dependents: '',
    Loan_Purpose: '',
    Mall_Visits_Per_Month: '',
    Mall_Spend_Average: ''
  });

  const bankOptions = [
    'State Bank of India',
    'HDFC Bank',
    'ICICI Bank',
    'Axis Bank',
    'Kotak Mahindra Bank',
    'Bank of Baroda',
    'Punjab National Bank',
    'Canara Bank',
    'Union Bank of India',
    'Indian Bank',
    'IndusInd Bank',
    'IDFC FIRST Bank',
    'Bandhan Bank',
    'Yes Bank',
    'South Indian Bank',
    'Ujjivan Small Finance Bank',
    'RBL Bank',
    'Federal Bank',
    'Lakshmi Vilas Bank',
    'Jammu & Kashmir Bank',
    'Others'
  ];

  const jobTitleOptions = [
    'Software Engineer',
    'Data Analyst',
    'Product Manager',
    'Financial Analyst',
    'Marketing Manager',
    'Sales Executive',
    'HR Manager',
    'Consultant',
    'Graphic Designer',
    'Project Manager',
    'Business Analyst',
    'Operations Manager',
    'Customer Service Executive',
    'Accountant',
    'Content Writer',
    'Web Developer',
    'UX/UI Designer',
    'Network Engineer',
    'Digital Marketer',
    'Administrative Assistant',
    'Research Scientist',
    'Others'
  ];

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prevFormData => {
      if (name === 'Owns_House' && value === 'Yes') {
        return {
          ...prevFormData,
          [name]: value,
          Rent_Amount: '' // Clear Rent_Amount when Owns_House is "Yes"
        };
      }
      return {
        ...prevFormData,
        [name]: value
      };
    });
  };

  const validateForm = () => {
    return Object.values(formData).every(value => value !== '');
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (!validateForm()) {
      toast.error('Please check fields again');
      return;
    }

    try {
      const response = await axios.post('http://127.0.0.1:5000/predict', formData);
      console.log('Prediction Results:', response.data);
      toast.success('Loan application submitted successfully!');
    } catch (error) {
      console.error('Error making prediction:', error.response ? error.response.data : error.message);
      toast.error('An error occurred while submitting the application.');
    }
  };

  return (
    <div className={classes.formContainer}>
      <ToastContainer />
      <Typography variant="h4">Loan Application Form</Typography>
      <form onSubmit={handleSubmit}>
        {/* Personal Information Section */}
        <div className={classes.formSection}>
          <Typography variant="h6">Personal Information</Typography>
          <div className={classes.formRow}>
            <div className={classes.formLine}>
              <TextField
                label="Full Name"
                name="Full_Name"
                value={formData.Full_Name}
                onChange={handleChange}
                className={classes.formField}
                variant="outlined"
              />
            </div>
            <div className={classes.formLine}>
              <TextField
                label="Address"
                name="Address"
                value={formData.Address}
                onChange={handleChange}
                className={classes.formField}
                variant="outlined"
              />
            </div>
          </div>
          <div className={classes.formRow}>
            <div className={classes.formLine}>
              <TextField
                label="PAN Number"
                name="PAN_Number"
                value={formData.PAN_Number}
                onChange={handleChange}
                className={classes.formField}
                variant="outlined"
              />
            </div>
            <div className={classes.formLine}>
              <TextField
                label="Age"
                type="number"
                name="Age"
                value={formData.Age}
                onChange={handleChange}
                className={classes.formField}
                variant="outlined"
                inputProps={{ min: "0" }}
              />
            </div>
          </div>
          <div className={classes.formRow}>
            <div className={classes.formLine}>
              <FormControl variant="outlined" className={classes.formField}>
                <InputLabel>Education Level</InputLabel>
                <Select
                  name="Education_Level"
                  value={formData.Education_Level}
                  onChange={handleChange}
                  label="Education Level"
                >
                  <MenuItem value=""><em>Select</em></MenuItem>
                  <MenuItem value="Graduate">Graduate</MenuItem>
                  <MenuItem value="PostGraduate">PostGraduate</MenuItem>
                  <MenuItem value="PhD">PhD</MenuItem>
                </Select>
                <FormHelperText>Education Level</FormHelperText>
              </FormControl>
            </div>
            <div className={classes.formLine}>
              <FormControl variant="outlined" className={classes.formField}>
                <InputLabel>Marital Status</InputLabel>
                <Select
                  name="Marital_Status"
                  value={formData.Marital_Status}
                  onChange={handleChange}
                  label="Marital Status"
                >
                  <MenuItem value=""><em>Select</em></MenuItem>
                  <MenuItem value="Single">Single</MenuItem>
                  <MenuItem value="Married">Married</MenuItem>
                  <MenuItem value="Widowed">Widowed</MenuItem>
                  <MenuItem value="Divorced">Divorced</MenuItem>
                </Select>
                <FormHelperText>Marital Status</FormHelperText>
              </FormControl>
            </div>
          </div>
          <div className={classes.formRow}>
            <div className={classes.formLine}>
              <TextField
                label="Dependents"
                type="number"
                name="Dependents"
                value={formData.Dependents}
                onChange={handleChange}
                className={classes.formField}
                variant="outlined"
                inputProps={{ min: "0" }}
              />
            </div>
            <div className={classes.formLine}>
              <FormControl variant="outlined" className={classes.formField}>
                <InputLabel>Loan Purpose</InputLabel>
                <Select
                  name="Loan_Purpose"
                  value={formData.Loan_Purpose}
                  onChange={handleChange}
                  label="Loan Purpose"
                >
                  <MenuItem value=""><em>Select</em></MenuItem>
                  <MenuItem value="Home Improvement">Home Improvement</MenuItem>
                  <MenuItem value="Education">Education</MenuItem>
                  <MenuItem value="Medical">Medical</MenuItem>
                  <MenuItem value="Other">Other</MenuItem>
                </Select>
                <FormHelperText>Loan Purpose</FormHelperText>
              </FormControl>
            </div>
          </div>
        </div>

        {/* Financial Information Section */}
        <div className={classes.formSection}>
          <Typography variant="h6">Financial Information</Typography>
          <div className={classes.formRow}>
            <div className={classes.formLine}>
              <TextField
                label="Company Name"
                name="Company_Name"
                value={formData.Company_Name}
                onChange={handleChange}
                className={classes.formField}
                variant="outlined"
              />
            </div>
            <div className={classes.formLine}>
              <TextField
                label="Current Salary"
                type="number"
                name="Current_Salary"
                value={formData.Current_Salary}
                onChange={handleChange}
                className={classes.formField}
                variant="outlined"
                inputProps={{ min: "0" }}
              />
            </div>
          </div>
          <div className={classes.formRow}>
            <div className={classes.formLine}>
              <TextField
                label="Previous Salary"
                type="number"
                name="Previous_Salary"
                value={formData.Previous_Salary}
                onChange={handleChange}
                className={classes.formField}
                variant="outlined"
                inputProps={{ min: "0" }}
              />
            </div>
            <div className={classes.formLine}>
              <FormControl variant="outlined" className={classes.formDropdown}>
                <InputLabel>Bank Name</InputLabel>
                <Select
                  name="Bank_Name"
                  value={formData.Bank_Name}
                  onChange={handleChange}
                  label="Bank Name"
                >
                  <MenuItem value=""><em>Select</em></MenuItem>
                  {bankOptions.map((bank, index) => (
                    <MenuItem key={index} value={bank}>{bank}</MenuItem>
                  ))}
                </Select>
                <FormHelperText>Bank Name</FormHelperText>
              </FormControl>
            </div>
          </div>
          <div className={classes.formRow}>
            <div className={classes.formLine}>
              <TextField
                label="Credit Score"
                type="number"
                name="Credit_Score"
                value={formData.Credit_Score}
                onChange={handleChange}
                className={classes.formField}
                variant="outlined"
                inputProps={{ min: "0" }}
              />
            </div>
            <div className={classes.formLine}>
              <TextField
                label="Number of Credit Cards"
                type="number"
                name="Number_of_Credit_Cards"
                value={formData.Number_of_Credit_Cards}
                onChange={handleChange}
                className={classes.formField}
                variant="outlined"
                inputProps={{ min: "0" }}
              />
            </div>
          </div>
          <div className={classes.formRow}>
            <div className={classes.formLine}>
              <TextField
                label="Total Credit Limit"
                type="number"
                name="Total_Credit_Limit"
                value={formData.Total_Credit_Limit}
                onChange={handleChange}
                className={classes.formField}
                variant="outlined"
                inputProps={{ min: "0" }}
              />
            </div>
            <div className={classes.formLine}>
              <TextField
                label="Number of Loans"
                type="number"
                name="Number_of_Loans"
                value={formData.Number_of_Loans}
                onChange={handleChange}
                className={classes.formField}
                variant="outlined"
                inputProps={{ min: "0" }}
              />
            </div>
          </div>
        </div>

        {/* Employment Details Section */}
        <div className={classes.formSection}>
          <Typography variant="h6">Employment Details</Typography>
          <div className={classes.formRow}>
            <div className={classes.formLine}>
              <TextField
                label="Employment Duration"
                name="Employment_Duration"
                value={formData.Employment_Duration}
                onChange={handleChange}
                className={classes.formField}
                variant="outlined"
              />
            </div>
            <div className={classes.formLine}>
              <FormControl variant="outlined" className={classes.formDropdown}>
                <InputLabel>Job Title</InputLabel>
                <Select
                  name="Job_Title"
                  value={formData.Job_Title}
                  onChange={handleChange}
                  label="Job Title"
                >
                  <MenuItem value=""><em>Select</em></MenuItem>
                  {jobTitleOptions.map((title, index) => (
                    <MenuItem key={index} value={title}>{title}</MenuItem>
                  ))}
                </Select>
                <FormHelperText>Job Title</FormHelperText>
              </FormControl>
            </div>
          </div>
          <div className={classes.formRow}>
            <div className={classes.formLine}>
              <TextField
                label="Bonuses and Allowances"
                type="number"
                name="Bonuses_Allowances"
                value={formData.Bonuses_Allowances}
                onChange={handleChange}
                className={classes.formField}
                variant="outlined"
                inputProps={{ min: "0" }}
              />
            </div>
            <div className={classes.formLine}>
              <TextField
                label="Savings"
                type="number"
                name="Savings"
                value={formData.Savings}
                onChange={handleChange}
                className={classes.formField}
                variant="outlined"
                inputProps={{ min: "0" }}
              />
            </div>
          </div>
          <div className={classes.formRow}>
            <div className={classes.formLine}>
              <TextField
                label="Investments"
                type="number"
                name="Investments"
                value={formData.Investments}
                onChange={handleChange}
                className={classes.formField}
                variant="outlined"
                inputProps={{ min: "0" }}
              />
            </div>
            <div className={classes.formLine}>
              <TextField
                label="Monthly Expenses"
                type="number"
                name="Monthly_Expenses"
                value={formData.Monthly_Expenses}
                onChange={handleChange}
                className={classes.formField}
                variant="outlined"
                inputProps={{ min: "0" }}
              />
            </div>
          </div>
        </div>

        {/* Property Details Section */}
        <div className={classes.formSection}>
          <Typography variant="h6">Property Details</Typography>
          <div className={classes.formRow}>
            <div className={classes.formLine}>
              <FormControl variant="outlined" className={classes.formDropdown}>
                <InputLabel>Owns House</InputLabel>
                <Select
                  name="Owns_House"
                  value={formData.Owns_House}
                  onChange={handleChange}
                  label="Owns House"
                >
                  <MenuItem value=""><em>Select</em></MenuItem>
                  <MenuItem value="Yes">Yes</MenuItem>
                  <MenuItem value="No">No</MenuItem>
                </Select>
                <FormHelperText>Owns House</FormHelperText>
              </FormControl>
            </div>
            {formData.Owns_House === 'No' && (
              <div className={classes.formLine}>
                <TextField
                  label="Rent Amount"
                  type="number"
                  name="Rent_Amount"
                  value={formData.Rent_Amount}
                  onChange={handleChange}
                  className={classes.formField}
                  variant="outlined"
                  inputProps={{ min: "0" }}
                />
              </div>
            )}
          </div>
          <div className={classes.formRow}>
            <div className={classes.formLine}>
              <TextField
                label="Grocery Expense"
                type="number"
                name="Grocery_Expense"
                value={formData.Grocery_Expense}
                onChange={handleChange}
                className={classes.formField}
                variant="outlined"
                inputProps={{ min: "0" }}
              />
            </div>
            <div className={classes.formLine}>
              <TextField
                label="Current EMIs"
                type="number"
                name="Current_EMIs"
                value={formData.Current_EMIs}
                onChange={handleChange}
                className={classes.formField}
                variant="outlined"
                inputProps={{ min: "0" }}
              />
            </div>
          </div>
          <div className={classes.formRow}>
            <div className={classes.formLine}>
              <TextField
                label="Date of Previous Hike"
                type="date"
                name="Date_Previous_Hike"
                value={formData.Date_Previous_Hike}
                onChange={handleChange}
                className={classes.formField}
                InputLabelProps={{ shrink: true }}
              />
            </div>
            <div className={classes.formLine}>
              <TextField
                label="Date of Next Hike"
                type="date"
                name="Date_Next_Hike"
                value={formData.Date_Next_Hike}
                onChange={handleChange}
                className={classes.formField}
                InputLabelProps={{ shrink: true }}
              />
            </div>
          </div>
          <div className={classes.formRow}>
            <div className={classes.formLine}>
              <TextField
                label="Age"
                type="number"
                name="Age"
                value={formData.Age}
                onChange={handleChange}
                className={classes.formField}
                variant="outlined"
                inputProps={{ min: "0" }}
              />
            </div>
            <div className={classes.formLine}>
              <TextField
                label="Number of Dependents"
                type="number"
                name="Number_of_Dependents"
                value={formData.Number_of_Dependents}
                onChange={handleChange}
                className={classes.formField}
                variant="outlined"
                inputProps={{ min: "0" }}
              />
            </div>
          </div>
        </div>

        {/* Additional Information Section */}
        <div className={classes.formSection}>
          <Typography variant="h6">Additional Information</Typography>
          <div className={classes.formRow}>
            <div className={classes.formLine}>
              <TextField
                label="Remarks"
                name="Remarks"
                value={formData.Remarks}
                onChange={handleChange}
                className={classes.formField}
                variant="outlined"
                multiline
                rows={4}
              />
            </div>
            <div className={classes.formLine}>
              <TextField
                label="Additional Details"
                name="Additional_Details"
                value={formData.Additional_Details}
                onChange={handleChange}
                className={classes.formField}
                variant="outlined"
                multiline
                rows={4}
              />
            </div>
          </div>
        </div>

        <div className={classes.buttonContainer}>
          <Button
            type="submit"
            variant="contained"
            color="primary"
            className={classes.submitButton}
          >
            Submit
          </Button>
          <Button
            type="button"
            variant="contained"
            color="secondary"
            className={classes.resetButton}
            onClick={handleReset}
          >
            Reset
          </Button>
        </div>
      </form>
    </div>
  );
};

export default LoanForm;
